function processRegistration(){if(validateForm("register_form")!=false){var e=$("#password").val();if($("#password").val()!=$("#confirm_password").val()){popUpMsg("Passwords do not match.");return false}else if(e.length<8){popUpMsg("Password must be at least 8 characters long.");return false}var t=createDocFromForm("register_form");t.url=site_url+"register";var n=saveEntry(t);if(n=="pass"){location.replace(site_url);return true}else{popUpMsg(n);return false}}return false}$(document).ready(function(){$("#zip_container").css("padding-left","30px");$("#company_container").addClass("col-lg-offset-1");$("#client_name_container").addClass("col-lg-offset-2");$("#email_container").addClass("col-lg-offset-1");$("#phone_number_container").addClass("col-lg-offset-2");$("#password_container").addClass("col-lg-offset-1");$("#confirm_password_container").addClass("col-lg-offset-2");$("#address_container").addClass("col-lg-offset-1");$("#city_container").addClass("col-lg-offset-2");$("#state_container").addClass("col-lg-offset-1");$("#zip_container").addClass("col-lg-offset-2");$("<h3>Required Fields:</h3>").insertBefore("#company_container");$('<div class="clear"><hr></div><h3>Optional Fields:</h3>').insertBefore("#address_container");$("#submitBtn").click(function(){processRegistration()})})